module Day5 where

import Data.Char(toUpper)
import Data.Foldable(foldl')
import Data.Function(on)
import Utility((<$$>))

day5Input :: String
day5Input = ""

isEqualCI :: Char -> Char -> Bool
isEqualCI = on (==) toUpper

processedLength :: String -> Int
processedLength = length . foldl' f ""
  where f :: String -> Char -> String
        f (x:xs) c | c /= x && (isEqualCI c x) = xs
        f l c = c:l

allLetters :: String
allLetters = "abcdefghijklmnopqrstuvwxyz"

day5a :: Int
day5a = processedLength day5Input

day5b :: Int
day5b = minimum $ processedLength . ($ day5Input) . filter <$> not <$$> isEqualCI <$> allLetters